import Element from "./Component/Element";

export default function TodoList({todos, setTodos}) {
    return (
        <div className='row row-cols-2 row-cols-md-4 g-2 px-3'>
            {todos.map((todo, index) => (
                <Card todo={todo} setTodos={setTodos} key={todo.id}/>
            ))}
        </div>
    )
}
